*  klif martwy – położony poza strefą oddziaływania fal, a więc nie podlegający już procesowi abrazji; zwykle pokryty grubą warstwą osadów stokowych; 
*  klif odmłodzony – klif martwy, ponownie jednak podcinany przez fale wskutek obniżenia się wybrzeża, podniesienia poziomu wody, lub okresowo w czasie bardzo silnych sztormów. Ze względu na ułożenie warstw skalnych wyróżnia się: 
*  klif strukturalny – utworzony w warstwach nachylonych w stronę lądu; 
